/**
 * Created by Lenovo on 2019/8/10.
 */
import React from 'react';
import '../share.css';
export default class List extends React.Component {

    render(){
        const {leftIcon,leftTitle,rightTitle,rightIcon} = this.props;
        return(
            <div className="cm-item cm-jc-sb">
            <div>
                <img src={leftIcon} alt="" className="cm-img-small-icon"/>
                <span className="cm-c-333">{leftTitle}</span>
            </div>
            <div className="cm-flex cm-ai-c"><span className="cm-c-999">{rightTitle}</span><img src={rightIcon} alt="" className="cm-img-small-icon"/></div>
        </div>
        )
    }
}
